import { TodoCount } from './TodoCount';
import './App.css';

function App() {
  return (
    <div className="App">
      <TodoCount
      completed={3}
      total={4}/>

      <TodoSearch/>
      <TodoList>
        <TodoItem/>
        <TodoItem/>
        <TodoItem/>
      </TodoList>

      <CreateTodoButtom/>

    </div>
  );
}


function TodoItem() {
  return (
    <li>
      <span>V</span>
      <p>Llorar con la llorona</p>
      <span>X</span>
    </li>
  );
}

export default App;
